import { Routes, Route } from "react-router-dom";
import Dashboard from "./Dashboard";

const AdminLayout = () => {
  return (
    <div>
      <h2>ADMIN PANEL</h2>

      <Routes>
        <Route path="" element={<Dashboard />} />
      </Routes>
    </div>
  );
};

export default AdminLayout;
